import './Header.css';
import { Link } from 'react-router-dom';


const Header = () => {
  return (
    < >
    <div className='wrap'>
    <nav className="navbar">
      <div className='Logo'>
        <a href='#'> LOGO<img /> </a>
      </div>
      <div className='nav-item'>
        <Link to="/">Home</Link>
      </div>
</nav>
</div>
    </ >
  )
}

export default Header
